import React, { Component } from "react";

//Components
import CustomMenu from "../components/custom-menu/custom-menu";

class ValidateCommande extends Component {
  constructor(props) {
    super(props);

    this.state = {
      toRegister: false
    };
  }

  handleNavigate = e => {
    e.preventDefault();
    this.setState({ toRegister: true });
  };

  render() {
    return (
      <CustomMenu screenName="Validate Commande">
        <div className="prueba-de-contenido">
          <h3>Validate Commande</h3>
        </div>
      </CustomMenu>
    );
  }
}

export default ValidateCommande;
